full_reasoning:
Step-by-step reasoning:

1. Key psychological mechanisms: Responders care not only about their absolute monetary payoff (split_self) but also about whether the division respects a fairness norm based on contributions. The norm is generated by comparing the participant’s token count relative to the combined tokens to determine what their “fair share” of the combined earning should be. Any shortfall relative to that fair share produces a disutility.

2. Mechanism interaction: The responder values the monetary offer (split_self) scaled by a baseline sensitivity parameter, but if the offer falls below the fairness norm then a penalty proportional to the deviation is subtracted. This captures a sensitivity to disadvantageous inequity without the need to model rejection utility.

3. Mathematical form: A linear utility model is adopted. First, compute the fair share as a proportion of the combined earning. Then, the utility is the scaled offer minus a fairness penalty applied only if the offer is less than the fair share. This takes the general form: 
  U = δ × split_self – φ × max(fair_share – split_self, 0)

4. Parameters needed: 
  • δ (delta) is a baseline scaling parameter for monetary payoff.
  • φ (fairness_aversion) is the fairness penalty parameter that captures the sensitivity to receiving less than one’s fair share.
Both are learnable parameters with generous finite bounds. (We use two parameters, which is within the allowed range.)

5. Mapping of model variables to the observable data: 
  • split_self and combined_earning are directly observed.
  • token_self and token_opp are also available in the dataset and are used to compute the fair share.
  • The rejection option is not modeled because we calculate the utility only for acceptance.
  • The parameters δ and φ will be recovered from responder decisions based on their observed chosen offers.

Below is the formal specification:

<MODEL>
U_responder = delta * split_self - fairness_aversion * max( (combined_earning * (token_self/(token_self + token_opp))) - split_self , 0 )
</MODEL>

